const R =require('ramda')
/**
 * Judge a set is it another set's childSet
 * @function
 * @param {Set} childSet
 * @param {Set} supperSet
 * @example
 * isSupperSet(
 * 		new Set([1, {a: 2}, 3]),
 * 		new Set([1, {a: 2}, 3, 4])
 * )
 * // return false
* */
const isSuperSet=R.curry(
	(childSet,supperSet)=>R.all(
		(item)=>supperSet.has(item),
		childSet
	)
)

module.exports= isSuperSet